import React from "react";
import './Section5.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Pathmodel from '../Section1/comp.svg'
function Section5(){
    return(
<div className="Section1-whole">
<Container className="Section1">
<Row >
        <Col sm={5}>
        <h1 className="Section1-content">Helping a local</h1>
        <h1 className="Color-bg" >business reinvents itself</h1>
<p className="Section2-content-parah">We reached here with our hard work and dedication</p>
<button className="Section2-button">Register</button></Col>
<Col sm={6}><img src={Pathmodel} alt="src" className="Section1-img"></img></Col>
</Row>


</Container>
</div>
    );
}
export default Section5;
